import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import cl from './Portfolio.module.css';


const Portfolio = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 2,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1000,
        arrows: false,
    };
    return (
        <Slider {...settings}>
            <div className={cl.Slider}>
                <div className={cl.sliderTitle}>Собственное производство</div>
                <div className={cl.bodySlide}>
                    <div className='card'>
                        <img src={require('../../photos/production/BKL_9167.jpg')} alt='Upload error' />
                    </div>
                    <div className='card'>
                        <img src={require('../../photos/production/BKL_9126.jpg')} alt='Upload error' />
                    </div>
                    <div className='card'>
                        <img src={require('../../photos/restorationDiatone2017/BKL_4930.jpg')} alt='Upload error' />
                    </div>
                    <div className='card'>
                        <img src={require('../../photos/production/BKL_0873.jpg')} alt='Upload error' />
                    </div>
                    <div className='card'>
                        <img src={require('../../photos/production/BKL_0861.jpg')} alt='Upload error' />
                    </div>
                    <div className='card'>
                        <img src={require('../../photos/TLM12015/TLM1/1600/BKL_9612.jpg')} alt='Upload error' />
                    </div>
                </div>
            </div>
        </Slider>
    );
};

export default Portfolio;
